from typing import List
class Solution:
    def countPyramids(self, grid: List[List[int]]) -> int:
        H, W = len(grid), len(grid[0])

        cp = [[0 for _ in range(W)] for _ in range(H)]
        for i in range(H):
            for j in range(W):
                cp[i][j] = grid[~i][j]

        # check from the bottom
        def count(A):
            ans = 0
            for i in range(1, H):
                for j in range(1, W-1):
                    if A[i][j] and A[i-1][j]:
                        A[i][j] = min(A[i-1][j-1], A[i-1][j+1])+1
                        ans += A[i][j]-1
            return ans
        
        return count(grid)+count(cp)

print(Solution().countPyramids([[0,1,1,0],[1,1,1,1]]))
